  { name: 'UI Design' },
  { name: 'UX Design' },
  { name: 'Wireframe' },
  { name: 'Diagramming' },
];

function Link() {
  const listItems = linkBloco1.map((link) => (
    <li key={link.name}>
      <a href="#">{link.name}</a>
    </li>
  ));
}

